    "Management of aspen plant communities on the National Elk Refuge, Wyoming",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2016-10-29T18:58:02.190022",nt"name": "management-of-aspen-plant-communities-on-the-national-elk-refuge-wyoming",nt"isopen":
    false,nt"url": null,nt"notes": "There are 1,860 acres (753 ha) of aspen
    (Populus tremuloides) plant communities on the National Elk Refuge (NER). Aspen
    is an important tree species on the Refuge, providing ecological as well as aesthtic
    diversity. Therefore, aspen communities should, if possible, be maintained. The
    last wildfire to sweep the Refuge's aspen communities occurred in 1879. As a result,
    the lack of fire, browsing by elk, moose and deer, and conifer invasion have contributed
    to some mature aspen stands becoming decadent, suffering from overbrowsing of regeneration,
    or conversion to coniferous forest. An aspen management program, initiated in April
    1987, seeks ways to perpetuate aspen on the Refuge in approximately its present
    abundance and distribution. This program inventoried 143 aspen stands on the refuge
    and baseline data was collected. Results from this inventory were used to evaluate
    stands that would benefit from treatment and management. This report discusses the
    1987 aspen inventory methods, results, and conclusions.",nt"license_title":
